def solve(num):
    result = 0
    i = 0
    while num:
        bit = num & 1
        if bit == 0 and i % 2 == 1:
            bit = 1
        elif bit == 1 and i % 2 == 0:
            bit = 0
        result |= bit << i
        i += 1
        num >>= 1
    return result
